INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "キャル", -363.0, 106001, 0.0, 7001, "2015/12/17 15:00:00", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0, 7, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "コッコロ", -363.0, 105901, 0.0, 7002, "2015/12/17 15:00:00", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0, 7, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "ペコリーヌ", -363.0, 105801, 0.0, 7003, "2015/12/17 15:00:00", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0, 7, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "ペコリーヌ", -363.0, 105801, 0.0, 10001, "2015/12/17 15:00:00", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0, 10, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "キャル", -363.0, 106001, 0.0, 10002, "2015/12/17 15:00:00", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0, 10, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "コッコロ", -363.0, 105901, 0.0, 10003, "2015/12/17 15:00:00", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0, 10, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "シェフィ", -363.0, 106401, 0.0, 10004, "2015/12/17 15:00:00", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 2104010, 10, 2, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "ペコリーヌ", -416.5, 105801, 0.0, 12001, "2015/12/17 15:00:00", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0, 12, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "キャル", -363.0, 106001, 0.0, 13001, "2015/12/17 15:00:00", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0, 13, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "コッコロ", -363.0, 105901, 0.0, 13002, "2015/12/17 15:00:00", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0, 13, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "シェフィ", -363.0, 106401, 0.0, 13003, "2015/12/17 15:00:00", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 2104010, 13, 2, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "ペコリーヌ", -363.0, 105801, 0.0, 13004, "2015/12/17 15:00:00", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0, 13, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "コッコロ", -363.0, 105901, 0.0, 14001, "2015/12/17 15:00:00", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0, 14, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "シェフィ", -363.0, 106401, 0.0, 14002, "2015/12/17 15:00:00", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 2104010, 14, 2, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "ペコリーヌ", -363.0, 105801, 0.0, 14003, "2015/12/17 15:00:00", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0, 14, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "キャル", -363.0, 106001, 0.0, 14004, "2015/12/17 15:00:00", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0, 14, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "コッコロ", -470.0, 105901, 0.0, 15001, "2015/12/17 15:00:00", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0, 15, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "シェフィ", -363.0, 106401, 0.0, 16001, "2015/12/17 15:00:00", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 2104010, 16, 2, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "ペコリーヌ", -363.0, 105801, 0.0, 16002, "2015/12/17 15:00:00", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0, 16, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "キャル", -363.0, 106001, 0.0, 16003, "2015/12/17 15:00:00", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0, 16, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "コッコロ", -363.0, 105901, 0.0, 16004, "2015/12/17 15:00:00", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0, 16, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "コッコロ", -363.0, 105901, 0.0, 17002, "2015/12/17 15:00:00", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0, 17, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "キャル", -363.0, 106001, 0.0, 17004, "2015/12/17 15:00:00", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0, 25, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "コッコロ", -363.0, 105901, 0.0, 17005, "2015/12/17 15:00:00", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0, 25, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "シェフィ", -363.0, 106401, 0.0, 17006, "2015/12/17 15:00:00", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 2104010, 25, 2, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "ペコリーヌ", -363.0, 105801, 0.0, 17007, "2015/12/17 15:00:00", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0, 25, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "カリン", -363.0, 190801, 0.0, 18001, "2015/12/17 15:00:00", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0, 18, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "カリン", -363.0, 190801, 0.0, 18002, "2015/12/17 15:00:00", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 0, 18, 1, "2030/12/17 14:59:59", 0, 1, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "カリン", -470.0, 190801, 0.0, 19001, "2015/12/17 15:00:00", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0, 19, 1, "2030/12/17 14:59:59", 0, 1, 3);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "カリン", -470.0, 190801, 0.0, 19002, "2015/12/17 15:00:00", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0, 19, 1, "2030/12/17 14:59:59", 0, 1, 4);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "カリン", -470.0, 190801, 0.0, 20001, "2015/12/17 15:00:00", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0, 20, 1, "2030/12/17 14:59:59", 0, 1, 5);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "カリン", -470.0, 190801, 0.0, 20002, "2015/12/17 15:00:00", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0, 20, 1, "2030/12/17 14:59:59", 0, 1, 6);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "キャル", -363.0, 106001, 0.0, 21001, "2015/12/17 15:00:00", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0, 21, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "コッコロ", -363.0, 105901, 0.0, 21002, "2015/12/17 15:00:00", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0, 21, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "シェフィ", -363.0, 106401, 0.0, 21003, "2015/12/17 15:00:00", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 2104010, 21, 2, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "ペコリーヌ", -363.0, 105801, 0.0, 21004, "2015/12/17 15:00:00", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0, 21, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "カリン", -430.0, 190801, 0.0, 22001, "2015/12/17 15:00:00", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0, 22, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "カリン", -430.0, 190801, 0.0, 22002, "2015/12/17 15:00:00", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0, 22, 1, "2030/12/17 14:59:59", 0, 1, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "カリン", -430.0, 190801, 0.0, 23001, "2015/12/17 15:00:00", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0, 23, 1, "2030/12/17 14:59:59", 0, 1, 3);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "カリン", -430.0, 190801, 0.0, 23002, "2015/12/17 15:00:00", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0, 23, 1, "2030/12/17 14:59:59", 0, 1, 4);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (8.0, "エリコ（バレンタイン）", -385.0, 109001, 4.08, 24001, "2019/01/31 12:00:00", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 0, 24, 1, "2030/12/17 14:59:59", 10011, 2, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (8.0, "エリコ（バレンタイン）", -385.0, 109001, 5.0, 24002, "2019/01/31 12:00:00", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 0, 24, 1, "2030/12/17 14:59:59", 10011, 2, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (8.0, "エリコ（バレンタイン）", -385.0, 109001, 10.11, 24003, "2019/01/31 12:00:00", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 0, 24, 1, "2030/12/17 14:59:59", 10011, 2, 3);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (8.0, "エリコ（バレンタイン）", -385.0, 109001, 4.0, 24004, "2019/01/31 12:00:00", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 0, 24, 1, "2030/12/17 14:59:59", 10011, 2, 4);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (8.0, "エリコ（バレンタイン）", -385.0, 109001, 6.0, 24005, "2019/01/31 12:00:00", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 0, 24, 1, "2030/12/17 14:59:59", 10011, 2, 5);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "エリコ（バレンタイン）", 0.0, 109002, 0.0, 24006, "2019/01/31 12:00:00", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0, 24, 1, "2030/12/17 14:59:59", 10011, 1, 6);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "エリコ（バレンタイン）", 0.0, 109002, 0.0, 24007, "2019/01/31 12:00:00", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0, 24, 1, "2030/12/17 14:59:59", 10011, 1, 7);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "エリコ（バレンタイン）", 0.0, 109002, 0.0, 24008, "2019/01/31 12:00:00", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0, 24, 1, "2030/12/17 14:59:59", 10011, 1, 8);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "エリコ（バレンタイン）", 0.0, 109002, 0.0, 24009, "2019/01/31 12:00:00", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0, 24, 1, "2030/12/17 14:59:59", 10011, 1, 9);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "エリコ（バレンタイン）", 0.0, 109002, 0.0, 24010, "2019/01/31 12:00:00", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0, 24, 1, "2030/12/17 14:59:59", 10011, 1, 10);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (8.0, "シズル（バレンタイン）", -385.0, 109101, 2.12, 24011, "2019/01/31 12:00:00", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 0, 24, 1, "2030/12/17 14:59:59", 10011, 2, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (8.0, "シズル（バレンタイン）", -385.0, 109101, 4.19, 24012, "2019/01/31 12:00:00", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 0, 24, 5, "2030/12/17 14:59:59", 10011, 2, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (8.0, "シズル（バレンタイン）", -385.0, 109101, 2.3, 24013, "2019/01/31 12:00:00", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 0, 24, 2, "2030/12/17 14:59:59", 10011, 4, 3);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "シズル（バレンタイン）", 0.0, 109102, 0.0, 24014, "2019/01/31 12:00:00", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0, 24, 1, "2030/12/17 14:59:59", 10011, 1, 4);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (8.0, "シズル（バレンタイン）", -385.0, 109101, 5.23, 24015, "2019/01/31 12:00:00", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 0, 24, 5, "2030/12/17 14:59:59", 10011, 2, 5);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "シズル（バレンタイン）", 0.0, 109102, 0.0, 24016, "2019/01/31 12:00:00", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0, 24, 1, "2030/12/17 14:59:59", 10011, 1, 6);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (8.0, "シズル（バレンタイン）", -385.0, 109101, 5.01, 24017, "2019/01/31 12:00:00", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 0, 24, 1, "2030/12/17 14:59:59", 10011, 2, 7);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "シズル（バレンタイン）", 0.0, 109102, 0.0, 24018, "2019/01/31 12:00:00", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0, 24, 1, "2030/12/17 14:59:59", 10011, 1, 8);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "シズル（バレンタイン）", 0.0, 109102, 0.0, 24019, "2019/01/31 12:00:00", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0, 24, 1, "2030/12/17 14:59:59", 10011, 1, 9);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "シズル（バレンタイン）", 0.0, 109102, 0.0, 24020, "2019/01/31 12:00:00", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0, 24, 1, "2030/12/17 14:59:59", 10011, 1, 10);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "シェフィ", -363.0, 106401, 0.0, 26001, "2015/12/17 15:00:00", "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 2104010, 26, 2, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "ペコリーヌ", -363.0, 105801, 0.0, 26002, "2015/12/17 15:00:00", "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 0, 26, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "キャル", -363.0, 106001, 0.0, 26003, "2015/12/17 15:00:00", "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 0, 26, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "コッコロ", -363.0, 105901, 0.0, 26004, "2015/12/17 15:00:00", "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 0, 26, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "シェフィ", -363.0, 106401, 0.0, 27001, "2015/12/17 15:00:00", "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 2104010, 27, 2, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "ペコリーヌ", -363.0, 105801, 0.0, 27002, "2015/12/17 15:00:00", "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 0, 27, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "キャル", -363.0, 106001, 0.0, 27003, "2015/12/17 15:00:00", "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 0, 27, 1, "2030/12/17 14:59:59", 0, 1, 1);
