INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "カリン", -363.0, 190801, 0.0, 28001, "2019/09/24 15:00:00", "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 0, 28, 1, "2030/12/17 14:59:59", 0, 1, 1);
