INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "ペコリーヌ", -363.0, 105801, 0.0, 43001, "2015/12/17 15:00:00", "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 0, 43, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "コッコロ", -363.0, 105901, 0.0, 43002, "2015/12/17 15:00:00", "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 0, 43, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "キャル", -363.0, 106001, 0.0, 43003, "2015/12/17 15:00:00", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 0, 43, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "アメス", -416.5, 123001, 0.0, 43004, "2015/12/17 15:00:00", "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 0, 44, 1, "2030/12/17 14:59:59", 0, 1, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "アメス", -416.5, 123001, 0.0, 43005, "2015/12/17 15:00:00", "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 0, 44, 1, "2030/12/17 14:59:59", 0, 1, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "アメス", -416.5, 123001, 5.79, 43006, "2015/12/17 15:00:00", "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 0, 45, 1, "2030/12/17 14:59:59", 0, 2, 3);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (0.0, "アメス", -371.5, 123001, 0.0, 46001, "2015/12/17 15:00:00", "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 0, 46, 1, "2030/12/17 14:59:59", 0, 1, 1);
